import { Route, Routes } from "react-router-dom";
import Layout from "./components/layout/Layout";
import AllCards from "./pages/AllCards";
import "./App.scss";

function App() {
  return (
    <Layout>
      <Routes>
        <Route path="/home" element={<AllCards />} />
      </Routes>
    </Layout>
  );
}

export default App;
